import React from 'react'
import axios from 'axios'

function Note(props) {
    
    const handleDelete = async (note)  => {
        await axios.delete(`/notes` + note.id, note )
    }

    const {title, content} = props.note


    return (
        <div className = 'note'>
            <h1>{title}</h1>
            <div>
                <span>{content}</span>
            </div>
            <button onClick = {handleDelete} > delete</button>

        </div>
    )
}

export default Note
